We might be able to represent things a bit better using MapField(EmbeddedDocumentField(NetworkInterface)), where NetworkInterface would be a new class that contains things like interface_type, host, port, ...

I'm thinking about something like this:

class NetworkInterface(EmbeddedDocument):
    meta = {'allow_inheritance': True}
    name = StringField()
    host = StringField()
    port = IntField()

class SshInterface(NetworkInterface):
    user = StringField()

class HttpInterface(NetworkInterface):
    pass

class Reservation(gj.Document):
    ...
    interfaces = MapField(EmbeddedDocumentField(NetworkInterface))

That might require to write a function to convert from json/dict to that, but it's a stronger base than a simple DictField().

We'll likely need that structure as a bit further down the line, we might need to create a service to proxy some of these connections. For instance some testbench host are not reachable from other parts of the network (TMA is isolated, and cannot be reached from anywhere but Azure basically) and even longer term, we'll likely deploy some testbeds outside of the SWI intranet.
